text:
DC permits vehicular pursuits with limitations.
 
Unlike DC, 2% of local police departments prohibit vehicular pursuits altogether.
 
@RepClayHiggins, who's from Louisiana, thinks he knows better than DC how to strike the proper balance in DC.

Federal LEOs recently executed a search that a judge called “the most illegal search I've ever seen in my life.” 
 
@DonBeyerVA and I plan to introduce a bill to require federal LEOs to wear body cameras, to ensure egregious rights violations like this do not happen.
 
https://t.co/pNql8lmXs6

Due to a quirk in federal law, @USRCDC is not eligible for federal grant funding.
 
@ChrisVanHollen and I introduced a bill to remedy this so Union Station can get the funding it needs for upgrades and renovations.
 
Release: https://t.co/GTW6dnOX1I https://t.co/wOey0CNDrl
